import React, { useState, useEffect } from "react";
import { Table, Input, Button, Select, Modal, message } from "antd";
import { connect } from "react-redux";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';

import { getEmployeeList } from "../../../actions/employee/employeeActions";

const Dashboard = (props) => {
  useEffect(() => {
    if (Object.keys(props.employee.employeeList).length > 0) {
      console.log(">>>Data>>", props.employee.employeeList);
    }
  }, [props.employee.employeeList]);

  const getData = () => {
    props.getEmployeeList();
  };
  return (
    <div className="my-3">
      <h3>Dashboard</h3>
      <Button variant="contained" color="primary" onClick={getData}>
        Get Data
      </Button>
      <List component="nav" aria-label="main mailbox folders">
        <ListItem button>
          <ListItemIcon>
            <InboxIcon />
          </ListItemIcon>
          <ListItemText primary="Inbox" />
        </ListItem>
      </List>
    </div>
  );
};

const mapStateToProps = (state) => ({
  employee: state.employee,
  messages: state.messages,
});

export default connect(mapStateToProps, { getEmployeeList })(Dashboard);
